script: |
  super -f text -I q7009.spq | sort > q7009.out

inputs:
  - name: q7009.spq
    data: |
      SELECT DISTINCT - ( - 60 ) AS col0 FROM tab1 (FORMAT parquet) WHERE NOT - - col1 * + col0 * + col1 - + + 61 * + col0 + col1 - 96 NOT BETWEEN + col0 AND 5;
  - name: tab1

outputs:
  - name: q7009.out
    data: |
